import { Store } from '../lib';
import { Accountancy } from '../models'; 

export default class AccountanciesStore extends Store {
  urlRoot = '/accountancy';
  model = Accountancy;

  constructor(adapter, appStore) {
    super(adapter, appStore);
      this.adapter = adapter;
      this.appStore = appStore;
  }
}
